import React from 'react';
import {connect} from 'react-redux';
import Light from '../components/light';


const Street = (color) => {
    return (
        <div className='m-5'>
            <div className="bg-secondary w-25 d-block mx-auto py-5">
                <Light color={color}/>
            </div>
            <div className='d-flex justify-content-around bg-secondary p-5'>
                <div className='rotate-left'>
                    <Light color={color}/>
                </div>
                <div className='rotate-right'>
                    <Light color={color}/>
                </div>
            </div>
            <div className="bg-secondary w-25 d-block mx-auto py-5">
                <Light color={'red'}/>
            </div>
        </div>
    )
}

const mapStateToProps = (state) => ({intersection: state.intersection})

export default connect(mapStateToProps)(Street)
